#include "MainWindow.h"
#include "Game.h"
#include <time.h>
///Constructor of Game
Game::Game(MainWindow& wnd)
	:
	wnd(wnd),
	gfx(wnd)
{
	Left.x = 100;
	SingleAI.x = 100;
	Right.x = 700;
	Single.x = 700;
}
///Calls the game functions
void Game::Go()
{
	gfx.BeginFrame();
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}
///Calls to update the model
void Game::UpdateModel()
{
	if (SingleChosen)
	{
		MoveSinglePaddle();
		MoveAIPaddle();
		Single.WallInsideBorder();
		SingleAI.WallInsideBorder();
		PongBallPhysics();
		IsGoal();
	}

	else if (MultiChosen)
	{
		///Moves player paddles
		MovePaddle();
		///Checks if player paddles are inside the given parameters.
		Left.WallInsideBorder();
		Right.WallInsideBorder();
		///Reactions of Pongball
		PongBallPhysics();
		IsGoal();
	}
	
	else
	{
		if ((wnd.kbd.KeyIsPressed(VK_DOWN) || wnd.kbd.KeyIsPressed(VK_UP)) && !WasPressed)
		{
			SingleSelected = !SingleSelected;
			MultiSelected = !MultiSelected;
			WasPressed = true;
		}
		if (!(wnd.kbd.KeyIsPressed(VK_DOWN) || wnd.kbd.KeyIsPressed(VK_UP)))
		{
			WasPressed = false;
		}
		if (wnd.kbd.KeyIsPressed(VK_RETURN) && MultiSelected)
		{
			IsStarted = true;
			MultiChosen = true;
		}
		if (wnd.kbd.KeyIsPressed(VK_RETURN) && SingleSelected)
		{
			IsStarted = true;
			SingleChosen = true;
		}
	}
}
///Composes frame
void Game::ComposeFrame()
{
	if (SingleChosen)
	{
		DrawBall(Pong.x, Pong.y, Pong.red, Pong.green, Pong.blue);
		DrawWall(Single.x, Single.y);
		DrawWall(SingleAI.x, SingleAI.y);
		DrawThePixelatedWall();
		DrawScoreboard();
	}
	else if (MultiChosen)
	{
		DrawBall(Pong.x, Pong.y, Pong.red, Pong.green, Pong.blue);
		DrawWall(Left.x, Left.y);
		DrawWall(Right.x, Right.y);
		DrawThePixelatedWall();
		DrawScoreboard();
	}
	else
	{
		DrawTitleScreen();
		DrawTitleSingle();
		DrawTitleMulti();

	}
}
///Draws the Pongball
void Game::DrawBall(int BallX, int BallY, int BallRed, int BallGreen, int BallBlue)
{
	///Middle layer of pixels
	gfx.PutPixel(BallX, BallY, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 2, BallY, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 3, BallY, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 1, BallY, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 2, BallY, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 3, BallY, BallRed, BallGreen, BallBlue);
	///Layer of Pixels above middle layer
	gfx.PutPixel(BallX - 3, BallY - 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 2, BallY - 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 1, BallY - 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX, BallY - 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY - 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 2, BallY - 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 3, BallY - 1, BallRed, BallGreen, BallBlue);
	///Layer of Pixels beneath top layer
	gfx.PutPixel(BallX - 2, BallY - 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 1, BallY - 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX, BallY - 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY - 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 2, BallY - 2, BallRed, BallGreen, BallBlue);
	///Top Layer
	gfx.PutPixel(BallX - 1, BallY - 3, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX, BallY - 3, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY - 3, BallRed, BallGreen, BallBlue);
	///Layer beneath middle layer
	gfx.PutPixel(BallX - 3, BallY + 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 2, BallY + 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 1, BallY + 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX, BallY + 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY + 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 2, BallY + 1, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 3, BallY + 1, BallRed, BallGreen, BallBlue);
	///Layer above bottom layer
	gfx.PutPixel(BallX - 2, BallY + 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX - 1, BallY + 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX, BallY + 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY + 2, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 2, BallY + 2, BallRed, BallGreen, BallBlue);
	///Bottom layer
	gfx.PutPixel(BallX - 1, BallY + 3, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX, BallY + 3, BallRed, BallGreen, BallBlue);
	gfx.PutPixel(BallX + 1, BallY + 3, BallRed, BallGreen, BallBlue);



}
///Draws the walls for the players (100 pixels tall)
void Game::DrawWall(int XCoordinate, int YCoordinate)
{
	if (XCoordinate == Left.x)
	{
		int Red = 255;
		int Blue = 255;
		int Green = 255;

		for (int i = -50; i <= 50; ++i)
		{
			gfx.PutPixel(XCoordinate, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 1, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 2, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 3, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 4, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 5, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 6, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 7, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 8, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 9, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 10, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate - 11, YCoordinate + i, Red, Green, Blue);

		}
	}

	if (XCoordinate == Right.x)
	{
		int Red = 255;
		int Green = 255;
		int Blue = 255;
		for (int i = -50; i <= 50; ++i)
		{
			gfx.PutPixel(XCoordinate, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 1, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 2, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 3, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 4, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 5, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 6, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 7, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 8, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 9, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 10, YCoordinate + i, Red, Green, Blue);
			gfx.PutPixel(XCoordinate + 11, YCoordinate + i, Red, Green, Blue);
		}
	}
}
///Draws the boundary between the player fields
void Game::DrawThePixelatedWall()
{
	int Red = 255;
	int Green = 255;
	int Blue = 255;
	for (int i = 1; i <= 599; i = i + 7)
	{
		
		gfx.PutPixel(399, i, Red, Green, Blue);
		gfx.PutPixel(398, i, Red, Green, Blue);
		gfx.PutPixel(400, i, Red, Green, Blue);
		gfx.PutPixel(399, i + 1, Red, Green, Blue);
		gfx.PutPixel(398, i + 1, Red, Green, Blue);
		gfx.PutPixel(400, i + 1, Red, Green, Blue);
		gfx.PutPixel(399, i - 1, Red, Green, Blue);
		gfx.PutPixel(398, i - 1, Red, Green, Blue);
		gfx.PutPixel(400, i - 1, Red, Green, Blue);
	

	}
}
