///Pong Ball physics :D
void Game::PongBallPhysics()
{
	Pong.x = Pong.x + Pong.vx;
	Pong.y = Pong.y + Pong.vy;
	///Sets initial VX and VY
	
	if (NewRound)
	{
		srand(time(NULL));
		Pong.y = rand() % 599;
		Pong.vx = rand() % 6 + 5;
		srand(time(NULL));
		Pong.vy = rand() % 9;
		int Random = rand() % 2;
		if (Random == 1)
		{
			Pong.vx = -Pong.vx;
		}
		NewRound = false;
	}
	IsTouchingWall();
	/// Touching top or bottom?
	if (Pong.y - 3 < 0)
	{
		DoBounceCalculation();
		Pong.y = 3;
	}
	if (Pong.y + 3 > 599)
	{
		DoBounceCalculation();
		Pong.y = 595;
	}
}
///Makes the angle be the same as when it hit the wall/boundary.
void Game::DoBounceCalculation()
{
	Pong.vy = -Pong.vy;
} 
///Swaps two variables
void Game::Swap(int &x, int &y)
{
	int SwapVariable = x;
	x = y;
	y = SwapVariable;
}
///Checks if ball is in opponent's goal, looked at and is working
void Game::IsGoal()
{
	if (MultiChosen)
	{
		if (Pong.x - 3 <= 0)
		{
			Right.Score++;
			Pong.x = 399;
			FirstTime = true;
		}
		if (Pong.x + 3 >= gfx.ScreenWidth)
		{
			Left.Score++;
			Pong.x = 399;
			FirstTime = true;
		}
	}
	if (SingleChosen)
	{
		if (Pong.x - 3 <= 0)
		{
			Single.Score++;
			Pong.x = 399;
			FirstTime = true;
		}
		if (Pong.x + 3 >= gfx.ScreenWidth)
		{
			SingleAI.Score++;
			Pong.x = 399;
			FirstTime = true;
		}
	}
}
///Moves player walls, looked at and is working
void Game::MovePaddle()
{
	if (wnd.kbd.KeyIsPressed(0x57))
	{
		Left.y = Left.y - 10;
	}
	if (wnd.kbd.KeyIsPressed(0x53))
	{
		Left.y = Left.y + 10;
	}
	if (wnd.kbd.KeyIsPressed(VK_UP))
	{
		Right.y = Right.y - 10;
	}
	if (wnd.kbd.KeyIsPressed(VK_DOWN))
	{
		Right.y = Right.y + 10;
	}
}
///Checks if Ball is touching Player paddles and changes velocity accordingly
void Game::IsTouchingWall()
{
	
	///Handles Leftplayer paddle
	if (MultiChosen)
	{
		if (Pong.x - Left.x - 3 < -Pong.vx && !(Pong.x - Left.x - 3 < 0))
		{
			int XGap = Pong.x - Left.x - 3;
			double BallVelocity = Pong.vy / Pong.vx;
			int YGap = XGap*BallVelocity;
			int TheoreticalX = Left.x;
			int TheoreticalY = Pong.y - YGap;
			if (TheoreticalX == Left.x && TheoreticalY - 3 <= Left.y + 50 && TheoreticalY + 3 >= Left.y - 50)
			{
				Pong.x = 104;
				Pong.y = TheoreticalY - 3;
				srand(time(NULL));
				Pong.vy = rand() % 9;
				srand(time(NULL));
				int Random = rand() % 2;
				if (Random == 1)
					Pong.vy = -Pong.vy;
				Pong.vx = rand() % 6 + 5;
			}
		}
		if (Right.x - Pong.x - 3 < Pong.vx && !(Right.x - Pong.x - 3 < 0))
		{
			int XGap = Right.x - Pong.x - 3;
			double BallVelocity = Pong.vy / Pong.vx;
			int YGap = XGap*BallVelocity;
			int TheoreticalX = Right.x;
			int TheoreticalY = Pong.y + YGap;
			if (TheoreticalX == Right.x && TheoreticalY - 3 <= Right.y + 50 && TheoreticalY + 3 >= Right.y - 50)																																																																																																																																					///Hi
			{
				Pong.x = 696;
				Pong.y = TheoreticalY;
				srand(time(NULL));
				Pong.vy = rand() % 9;
				int Random = rand() % 2;
				if (Random == 1)
					Pong.vy = -Pong.vy;
				srand(time(NULL));
				Pong.vx = rand() % 6 + 5;
				Pong.vx = -Pong.vx;
			}
		}
	}
	if (SingleChosen)
	{
		if (Pong.x - SingleAI.x - 3 < -Pong.vx && !(Pong.x - SingleAI.x - 3 < 0))
		{
			int XGap = Pong.x - SingleAI.x - 3;
			double BallVelocity = Pong.vy / Pong.vx;
			int YGap = XGap*BallVelocity;
			int TheoreticalX = SingleAI.x;
			int TheoreticalY = Pong.y - YGap;
			if (TheoreticalX == SingleAI.x && TheoreticalY - 3 <= SingleAI.y + 50 && TheoreticalY + 3 >= SingleAI.y - 50)
			{
				Pong.x = 104;
				Pong.y = TheoreticalY - 3;
				srand(time(NULL));
				Pong.vy = rand() % 9;
				srand(time(NULL));
				int Random = rand() % 2;
				if (Random == 1)
					Pong.vy = -Pong.vy;
				Pong.vx = rand() % 6 + 5;
			}
		}
		if (Single .x - Pong.x - 3 < Pong.vx && !(Single.x - Pong.x - 3 < 0))
		{
			int XGap = Single.x - Pong.x - 3;
			double BallVelocity = Pong.vy / Pong.vx;
			int YGap = XGap*BallVelocity;
			int TheoreticalX = Single.x;
			int TheoreticalY = Pong.y + YGap;
			if (TheoreticalX == Single.x && TheoreticalY - 3 <= Single.y + 50 && TheoreticalY + 3 >= Single.y - 50)																																																																																																																																					///Hi
			{
				Pong.x = 696;
				Pong.y = TheoreticalY;
				srand(time(NULL));
				Pong.vy = rand() % 9;
				int Random = rand() % 2;
				if (Random == 1)
					Pong.vy = -Pong.vy;
				srand(time(NULL));
				Pong.vx = rand() % 6 + 5;
				Pong.vx = -Pong.vx;
			}
		}
	}

}
