///Moves the paddle
void Game::MoveSinglePaddle()
{
	if (wnd.kbd.KeyIsPressed(VK_UP))
	{
		Single.y = Single.y - 10;
	}
	if (wnd.kbd.KeyIsPressed(VK_DOWN))
	{
		Single.y = Single.y + 10;
	}
}
///Moves the robo paddle
void Game::MoveAIPaddle()
{
	if (SingleAI.y > Pong.y)
	{
		SingleAI.y = SingleAI.y - 6;
	}
	if (SingleAI.y < Pong.y)
	{
		SingleAI.y = SingleAI.y + 6;
	}
}